import request from '@/utils/request'

/**
 * 获取本月工作台数据统计
 * @returns 工作台数据统计
 */
export const getMonthlyDashboardData = () => {
  return request({
    url: '/it_manager/dashboard/monthly',
    method: 'get'
  })
}

/**
 * 获取任务统计数据
 * @returns 任务统计数据
 */
export const getTaskStatistics = () => {
  return request({
    url: '/it_manager/task_statistics',
    method: 'get'
  })
}

/**
 * 获取仓库库存数据
 * @returns 仓库库存数据
 */
export const getWarehouseInventory = () => {
  return request({
    url: '/it_manager/warehouse_inventory',
    method: 'get'
  })
}

/**
 * 获取设备数据
 * @returns 仓库库存数据
 */
export const getDevice = () => {
    return request({
      url: '/it_manager/device_info',
      method: 'get'
    })
  }


/**
 * 获取员工分类统计数据
 * @returns 员工分类统计数据
 */
export const getEmployeeStatistics = () => {
  return request({
    url: '/it_manager/employee_statistics',
    method: 'get'
  })
}

/**
 * 获取员工分类统计数据
 * @returns 员工分类统计数据
 */
export const getRecentEmployees = ({ pageSize }) => {
    return request({
      url: '/it_manager/recent_user',
      method: 'get',
      params: { pageSize }  // 明确传递 pageSize 参数
    })
  }
